/// <summary>
///
/// </summary>
public void init()
{
    Query    query= new Query();

    str         allPools;
    super();
    allPools = HMClaimSelectionQueryRange::getPersonPools();
    allPools = subStr(allPools,0,strLen(allPools)-1);

    if (element.args().menuItemName() == menuItemDisplayStr(HMAllClaimsNoPoolMenuItem))
    {
        this.query().dataSourceTable(tableNum(HMClaimTable)).addRange(fieldNum(HMClaimTable, ClaimPool)).value(SysQuery::value(0));
    }
    if (element.args().menuItemName() == menuItemDisplayStr(HMAllClaimAssignedToAgentMenuItem))
    {
        this.query().dataSourceTable(tableNum(HMClaimTable)).addRange(fieldNum(HMClaimTable, ClaimAgent)).value(SysQuery::value(HMClaimSelectionQueryRange::getCurrentAgent()));
    }
    if (element.args().menuItemName() == menuItemDisplayStr(HMAllClaimAssignedToManagerMenuItem))
    {
        this.query().dataSourceTable(tableNum(HMClaimTable)).addRange(fieldNum(HMClaimTable, ClaimPool)).value(allPools);
    }
    if (element.args().menuItemName() == menuItemDisplayStr(HMAllClaimsInPoolAgentMenuItem))
    {
        this.query().dataSourceTable(tableNum(HMClaimTable)).addRange(fieldNum(HMClaimTable, ClaimAgent)).value(SysQuery::value(HMClaimSelectionQueryRange::getCurrentAgent()));
        this.query().dataSourceTable(tableNum(HMClaimTable)).addRange(fieldNum(HMClaimTable, ClaimAgent)).value(SysQuery::value(0));
        this.query().dataSourceTable(tableNum(HMClaimTable)).addRange(fieldNum(HMClaimTable, ClaimPool)).value(allPools);
    }


    if(element.args().menuItemName()==menuItemDisplayStr(HMAllClaimsWithOutstanding))
    {
        QueryBuildDataSource qbdsmmActivityParentLinkTable = this.query().dataSourceTable(tableNum(HMClaimTable)).addDataSource(tableNum(smmActivityParentLinkTable));
        qbdsmmActivityParentLinkTable.relations(false);
        qbdsmmActivityParentLinkTable.joinMode(JoinMode::ExistsJoin);
        qbdsmmActivityParentLinkTable.addLink(fieldnum(HMClaimTable,RecId ),fieldnum(smmActivityParentLinkTable, RefRecId));
        qbdsmmActivityParentLinkTable.addRange(fieldNum(smmActivityParentLinkTable,ParentType)).value(queryValue(smmActivityParentType::Claim));

        QueryBuildDataSource qbdsmmActivities = qbdsmmActivityParentLinkTable.addDataSource(tableNum(smmActivities));
        qbdsmmActivities.relations(false);
        qbdsmmActivities.joinMode(JoinMode::InnerJoin);
        qbdsmmActivities.addLink(fieldnum(smmActivities,ActivityNumber),fieldnum(smmActivityParentLinkTable, ActivityNumber));    
        qbdsmmActivities.addRange(fieldNum(smmActivities,Closed)).value(SysQuery::value(NoYes::No));

    }
}

