public void init()
{
    super();
    if (element.args().menuItemName() == menuItemDisplayStr(HMAllClaimsDeniedMenuItem))
    {
        this.query().dataSourceTable(tableNum(HMClaimVersion)).addRange(fieldNum(HMClaimVersion,Status)).value(SysQuery::value(HMClaimStatus::Denied));
    }
    if (element.args().menuItemName() == menuItemDisplayStr(HMAllClaimsPaidMenuItem))
    {
        this.query().dataSourceTable(tableNum(HMClaimVersion)).addRange(fieldNum(HMClaimVersion,Status)).value(SysQuery::value(HMClaimStatus::Paid));
    }
    if (element.args().menuItemName() == menuItemDisplayStr(HMAllClaimsSubmittedMenuItem))
    {
        this.query().dataSourceTable(tableNum(HMClaimVersion)).addRange(fieldNum(HMClaimVersion,Status)).value(SysQuery::value(HMClaimStatus::Submitted));
    }
    if (element.args().menuItemName() == menuItemDisplayStr(HMAllClaimsOnHoldMenuItem))
    {
        this.query().dataSourceTable(tableNum(HMClaimVersion)).addRange(fieldNum(HMClaimVersion,status)).value(SysQuery::value(HMClaimStatus::Rejected));
    }
}

/// <summary>
///
/// </summary>
public void init()
{
    QueryBuildDataSource qbdsCustTable;

    super();

    qbdsCustTable = this.query().dataSourceTable(tableNum(CustTable));
    qbdsCustTable.relations(false);
    qbdsCustTable.joinMode(JoinMode::OuterJoin);
    qbdsCustTable.clearLinks();
    qbdsCustTable.clearRanges();
    qbdsCustTable.addLink(fieldnum(HMPatient, CustTable),fieldnum(CustTable, RecId));
}

/// <summary>
///
/// </summary>
public void executeQuery()
{
    QueryBuildDataSource queryBuildDataSource;

    queryBuildDataSource = this.query().dataSourceTable(tableNum(smmActivityParentLinkTable));
    queryBuildDataSource.clearRanges();
    queryBuildDataSource.addRange(fieldNum(smmActivityParentLinkTable, ParentType)).value(queryValue(smmActivityParentType::Claim));
    queryBuildDataSource.addRange(fieldNum(smmActivityParentLinkTable, RefTableId)).value(queryValue(HMClaimTable.TableId));
    queryBuildDataSource.addRange(fieldNum(smmActivityParentLinkTable, RefRecId)).value(queryValue(HMClaimTable.RecId));

    super();
}

