/// <summary>
///
/// </summary>
public void lookup()
{
    super();

    HMICDCodesTmp populateHMICDCodesTmp()
    {
        HMICDCodesTmp hmICDCodesTmp;

        if(HMClaimTable.HMICDCode1)
        {
            hmICDCodesTmp.clear();
            hmICDCodesTmp.ICDCode = HMClaimTable.HMICDCode1;
            hmICDCodesTmp.ICDCodeIdentifier = 1;
            hmICDCodesTmp.insert();
        }
        if(HMClaimTable.HMICDCode2)
        {
            hmICDCodesTmp.clear();
            hmICDCodesTmp.ICDCode = HMClaimTable.HMICDCode2;
            hmICDCodesTmp.ICDCodeIdentifier = 2;
            hmICDCodesTmp.insert();
        }
        if(HMClaimTable.HMICDCode3)
        {
            hmICDCodesTmp.clear();
            hmICDCodesTmp.ICDCode = HMClaimTable.HMICDCode3;
            hmICDCodesTmp.ICDCodeIdentifier = 3;
            hmICDCodesTmp.insert();
        }
        if(HMClaimTable.HMICDCode4)
        {
            hmICDCodesTmp.clear();
            hmICDCodesTmp.ICDCode = HMClaimTable.HMICDCode4;
            hmICDCodesTmp.ICDCodeIdentifier = 4;
            hmICDCodesTmp.insert();
        }

        return hmICDCodesTmp;
    }

    Query query = new Query();
    QueryBuildDataSource qbds;
    QueryBuildRange queryBuildRange;

    SysTableLookup sysTableLookup = SysTableLookup::newParameters(tableNum(HMICDCodesTmp), this);
    sysTableLookup.addLookupField(fieldNum(HMICDCodesTmp, ICDCodeIdentifier));
    sysTableLookup.addLookupField(fieldNum(HMICDCodesTmp, ICDCode));
    qbds = query.addDataSource(tableNum(HMICDCodesTmp));

    sysTableLookup.parmQuery(query);
    sysTableLookup.parmTmpBuffer(populateHMICDCodesTmp());
    sysTableLookup.performFormLookup();
}

